import React from "react";
import newp from "./NewPost.module.css"

const NewPost = () => {
    return (
        <div className={newp.postedit}>
            <span>Моя лента</span>
            <div>
                <textarea>Что нового?</textarea>
            </div>
        </div>
    );
}

export default NewPost;
